const styles = {
  button: {
    backgroundColor: '#ff007f',
    height: 50,
    flexDirection: 'row',
    borderRadius: 50,
    overflow: 'hidden',
    alignItems: 'center',
    marginTop: 8,
    maxWidth: 260,
    marginLeft: 65,
    marginBottom: 20,
  },

  buttonText: {
    flex: 1,
    justifyContent: 'center',
    textAlign: 'center',
    color: '#FFF',
    fontFamily: 'Roboto_500Medium',
    fontSize: 16,
  },

  container: {
    backgroundColor: '#F0F0F5',
  },

  container2: {
    flex: 1,
    backgroundColor: '#F0F0F5'
  },

  editor: {
    marginLeft: 350
  },

    image: {
        borderWidth: 1,
        borderColor: 'black',
        borderRadius: 100,
        width: 160,
        height: 160,
        overflow: 'hidden',
        alignSelf: 'center',
    },

  input: {
    backgroundColor: "white",
    borderRadius: 25,
    maxWidth: 350,
    marginLeft: 10,
    padding: 8,
    marginTop: 0,
    marginBottom: 20,
    borderWidth: 0,
  },

  inputDesc: {
    backgroundColor: '#fff',
    borderRadius: 25,
    maxWidth: 350,
    marginLeft: 10,
    height: 120,
    paddingHorizontal: 10,
    paddingVertical: 10,
    marginTop: 0,
    marginBottom: 20,
  },

  text: {
    marginLeft: 14,
    fontSize: 20
  },

  title: {
    color: '#322153',
    fontSize: 20,
    fontFamily: 'Ubuntu_700Bold',
    maxWidth: 260,
    marginLeft: 60,
    textAlign: 'center',
  },

  view: {
    marginTop: 10
  },
}

export default styles;
